import React from 'react';
import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
    bold: {
        fontWeight: 'bold',
        fontSize: 25,
        paddingHorizontal: 10,
        paddingVertical: 5,
        backgroundColor: 'plum',
        borderRadius: 10
    },
    padding: {
        paddingVertical: 7.5
    },
    margin: {
        marginVertical: 10
    }
})

export default styles;
